import "../../css/App.css";
import React, {useEffect} from "react";
import GoBack from "../componets/GoHome";
import MenuBar from "../componets/MenuBar";
import { isAndroid, isIOS, isMobile} from "react-device-detect";
import addContent from "./contentCreator";

//vars
var content = [];
function SoftPage() {
  const [refresh, setRefresh] = React.useState(0);
  var filters = <></>;
  if(isAndroid){
    filters = (
      <>
        <input type="checkbox" defaultChecked={true} onClick={() => {update(); setRefresh(refresh + 1)}} id="showAndroid" />
        Android
        <br/>
        <input type="checkbox" onClick={() => {update(); setRefresh(refresh + 1)}} id="showDesktop" />
        Desktop 
        <br/>
        <input type="checkbox" onClick={() => {update(); setRefresh(refresh + 1)}} id="showIos" />
        Ios
      </>)
    content[0] = addContent("Android");
   
    
  } else if(isIOS){
    filters = (
      <>
        <input type="checkbox" defaultChecked={true} onClick={() => {update(); setRefresh(refresh + 1)}} id="showIos" />
        Ios
        <br/>
        <input type="checkbox" onClick={() => {update(); setRefresh(refresh + 1)}} id="showAndroid" />
        Android
        <br/>
        <input type="checkbox" onClick={() => {update(); setRefresh(refresh + 1)}} id="showDesktop" />
        Desktop
      </>)
  } else {    
    filters = (
      <>    
        <input type="checkbox" defaultChecked={true} onClick={() => {update(); setRefresh(refresh + 1)}} id="showDesktop" />
        Desktop
        <br/>
        <input type="checkbox" onClick={() => {update(); setRefresh(refresh + 1)}} id="showAndroid" />
        Android
        <br/>
        <input type="checkbox" onClick={() => {update(); setRefresh(refresh + 1)}} id="showIos" />
        Ios
      </>)
  }

  useEffect(() => {
    if (refresh == 0) {
      update()
      setRefresh(refresh +1)
    }
  });
  
  if(!isMobile){
    //ANCHOR jsx for pc
    return (
      <>
        <MenuBar/>
        <br/><br/><br/>
        <main style={{paddingRight:"10%", paddingLeft:"10%"}}>
            <div>{content[0]}</div>
            <div>{content[1]}</div>
            <div>{content[2]}</div>
        </main>
        <div style={{position: "absolute", top:"0%", bottom:"0", left:"1%", right:"90%",borderRight:"white dotted"}}>
          <br/><br/>
          <form style={{paddingTop:"15%"}}>
            <div style={{marginRight:"10%"}}>
              <span className="middle" style={{fontSize: "25px"}}>Filter</span>
              {filters}
            </div>
          </form>
        </div>
        <GoBack/>
      </>
    )
  } else {
    //ANCHOR jsx for mobile
    return (
      <>
        <MenuBar/>
        <br/><br/><br/>
        <main style={{paddingRight:"5%", paddingLeft:"40%"}}>
            <div>{content[0]}</div>
            <div>{content[1]}</div>
            <div>{content[2]}</div>
        </main>
        <div style={{position: "absolute", top:"0%", bottom:"0", left:"1%", right:"70%",borderRight:"white dotted"}}>
          <br/><br/>
          <form style={{paddingTop:"15%"}}>
            <div style={{marginRight:"10%"}}>
              <span className="middle" style={{fontSize: "25px"}}>Filter</span>
              {filters}
            </div>
          </form>
        </div>
        <GoBack/>
      </>
    )
    }
}

//ANCHOR Update
function update() {
  content = [];

  // witch platform
  var content = "Desktop";
  if(isAndroid){
   content = "Android"
  } else if(isIOS){
    content = "Ios"
  }

  //Get the oder
  var order = ["","",""]
  switch(content){
    case "Desktop":
      order[0] = content;
      order[1] = "Android";
      order[2] = "Ios";
      break;

    case "Android":
      order[0] = content;
      order[1] = "Desktop";
      order[2] = "Ios"
      break;

    case "Ios":
      order[0] = content;
      order[1] = "Android";
      order[2] = "Desktop"
      break;  
  }

  //create content and create filter
  var i = 0;
  var filter = [false, false, false]
  for (const obj in order && i++) {
    filter[i] = getChecked("show" + obj);
    if(filter[i]){
      content[i] = addContent(obj)
    }
  }
 
  //add lines between
  if(filter[0] && filter[1]){
    content[0] = <>{content[0]} <hr/></>
  }

  if(filter[1] && filter[2]){
    content[1] = <>{content[1]} <hr/></>
  }
}

function getChecked(id) {
  try {
    return document.getElementById(id).checked;
  } catch (error) {
    console.warn(error)
  }

}


export default SoftPage;
